import React,{useState} from 'react'
import { useStyles } from '../../styles/styles';
import { Button, TextField, Card } from "@material-ui/core";
import {Link } from "react-router-dom";
import {useDispatch} from 'react-redux';

function ImageComponent(){  
  
  const classes = useStyles();
  
  const dispatch = useDispatch();

  const [fields, setState] = useState({
    image: "",
  });

  const handleFieldChange = e => {
      setState({
          ...fields,
          [e.target.id] : e.target.value
      })
  }
  
  return (
    <div>
      <div class="global-container">
	<div class="card login-form">
	<div class="card-body mt 8">
		<h3 class="card-title text-center">Log in to Codepen</h3>
		<div class="card-text">
			<div class="alert alert-danger alert-dismissible fade show" role="alert">Incorrect username or password.</div>
			<form>
				<div class="form-group">
					<label for="exampleInputEmail1">Email address</label>
					<input type="email" class="form-control form-control-sm" id="exampleInputEmail1" aria-describedby="emailHelp"></input>
				</div>
				<div class="form-group">
					<label for="exampleInputPassword1">Password</label>
					<a href="" >Forgot password?</a>
					<input type="password" class="form-control form-control-sm" id="exampleInputPassword1"></input>
				</div>
				<button type="submit" class="btn btn-primary btn-block">Sign in</button>
				
				<div class="sign-up">
					Don't have an account? <a href="#">Create One</a>
				</div>
			</form>
		</div>
	</div>
</div>
</div>

    </div>
    )
}

export default ImageComponent;
